import React, {useEffect} from 'react';


const SuperBody = React.memo(function({data, sortedTag}){

    function dataTablePresentation(data){

        if(data.length <= 0){
            return <tr><td>empty data</td></tr>;
        }
        else {

            let resultArr = [];
            for(let i = 0; i < data.length; i++){
                let tempRow = [];
                let propCounter = 0;
                for(let prop in data[i]){
                    if(prop !== 'address') tempRow.push(<td className={'column_'+prop} key={propCounter++}>{data[i][prop]}</td>);
                    else if(prop === 'address') {
                        // {streetAddress, city, state, zip}
                        let tempAddress = '';
                        for(let position in data[i][prop]){
                            tempAddress += data[i][prop][position] + ' ';
                        }
                        tempRow.push(<td className={'column '+prop} key={propCounter++}>{tempAddress}</td>);
                    }
                }
                resultArr.push(<tr className={'row '+i} key={i}>{tempRow}</tr>)
            }
            return resultArr
        }
    }

    return <tbody>{/*div body*/}
        {dataTablePresentation(data) || <tr><td>body</td></tr>}
    </tbody>
});

export default SuperBody;
